import { TabPanel } from '@material-ui/lab';
import { useState } from "react";

class TextInfo extends Component {
  constructor(props) {
    super(props);
  }
  handleChange(e, v) {
    console.log(e)
    console.log(v)
  }
  render(){
    return (
      <div className="tabs">
        <input id="all" type="radio" name="tab_item" checked />
        <label className="tab_item" for="all">総合</label>
        <input id="programming" type="radio" name="tab_item" />
        <label className="tab_item" for="programming">プログラミング</label>
        <input id="design" type="radio" name="tab_item" />
        <label className="tab_item" for="design">デザイン</label>
      </div>
    );
  }
}

TextInfo = connect((state) => state)(TextInfo);
export default TextInfo;
